INSERT INTO `wp_genaero_videos` (`id`, `link_id`, `member_id`, `title`, `description`, `youtube`, `favourite`, `create_date`, `update_date`) VALUES
(5, 188, 2, 'Gummi Bear Sacrifice', 'Craig Beals shows how much energy is stored up as calories in a gummy bear. The reaction involves sucrose from the gummy bear and sodium chlorate (potassium chlorate can be used as well). Craig then shows the energy in an entire serving of gummy bears and the experiment erupts into a fireball of as the sugar calories undergo a combustion reaction. This science demonstration is also known as \\\\\\\"Dancing Gummy Bears\\\\\\\".', 'https://www.youtube.com/watch?v=z7ZuBjPRFUk', 3, '2018-01-08 16:01:17', '2018-01-10 00:01:48'),
(6, 189, 2, 'Gummi Bear Sacrifice', 'Craig Beals shows how much energy is stored up as calories in a gummy bear. The reaction involves sucrose from the gummy bear and sodium chlorate (potassium chlorate can be used as well). Craig then shows the energy in an entire serving of gummy bears and the experiment erupts into a fireball of as the sugar calories undergo a combustion reaction. This science demonstration is also known as \\\\\\\"Dancing Gummy Bears\\\\\\\".', 'https://www.youtube.com/watch?v=z7ZuBjPRFUk', 0, '2018-01-08 16:26:41', '2018-01-10 00:01:48'),
(7, 193, 3, 'Let There Be Rocket', 'Hey Reckers! Ever wondered how to build an awesome rocket? Look no further, Andrew W.K. and real life NASA astronaut, Mike Meacham has it covered. Plus Bobby Lee swings by in his awesome food truck to help launch the rocket! ', 'https://www.youtube.com/watch?v=7LQ4TcCTlqk', 0, '2018-01-08 17:25:01', '0000-00-00 00:00:00'),
(8, 194, 3, 'Underwater Candle', 'How to burn a candle underwater. Simple science trick. Watch the flame continue to burn beneath the water level as the wax holds back the water.', 'https://www.youtube.com/watch?v=8XSzJibma1s', 0, '2018-01-08 17:25:59', '0000-00-00 00:00:00'),
(9, 195, 3, 'Pepper and Water Science Trick', 'Water surface tension science experiment using a white plate, water, ground black pepper and soap or washing up liquid. Watch the black pepper scatter as you break down the water surface tension using soap. Easy to follow demonstration which makes a fun magic trick. ', 'https://www.youtube.com/watch?v=ho0o7H6dXSU', 0, '2018-01-08 17:27:34', '0000-00-00 00:00:00'),
(10, 201, 3, 'Rock Candy Recipe - Crystallization of Sugar', 'Welcome to science at home in this experiment we are making rock candy by crystallizing sugar. This is a simple experiment that can be done at home with some water, sugar and a stove. When a supersaturated solution of sugar cools, the sugar in the solution collects together into crystals known as Rock Candy. At the end of this episode you will be able to make your very own Rock Candy, explain what happens during crystallization and explain what a supersaturated solution is.', 'https://www.youtube.com/watch?v=VpOU0Fo7QfU', 0, '2018-01-09 17:30:13', '0000-00-00 00:00:00'),
(11, 202, 2, 'Gummi Bear Sacrifice', 'Craig Beals shows how much energy is stored up as calories in a gummy bear. The reaction involves sucrose from the gummy bear and sodium chlorate (potassium chlorate can be used as well). Craig then shows the energy in an entire serving of gummy bears and the experiment erupts into a fireball of as the sugar calories undergo a combustion reaction. This science demonstration is also known as \\\\\\\"Dancing Gummy Bears\\\\\\\".', 'https://www.youtube.com/watch?v=z7ZuBjPRFUk', 0, '2018-01-09 23:49:54', '2018-01-10 00:01:48');
