(212, 1, '2018-01-10 03:00:07', '2018-01-10 03:00:07', '<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">When Anna holds an engine part in her hands, she doesn\'t just see metal and bolts: she sees hundreds of possibilities.</span></p>\r\n<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">Working as a repair technology manager, Anna is sent parts that have been flying in an engine and now need to be repaired or replaced.</span></p>\r\n<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">Her job is to find ways to repair the part and keep it flying. And if it can\'t be done today, she\'ll partner with people all over the world to work out how to extend its life in the future.</span></p>', 'Annie Tai', 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Non iure ipsum fugit incidunt enim, dolore magnam illum eligendi', 'publish', 'closed', 'closed', '', 'annie-tai', '', '', '2018-01-14 13:10:35', '2018-01-14 13:10:35', '', 0, 'http://localhost/generationaerospace/?post_type=genaero_trailblazers&#038;p=212', 0, 'genaero_trailblazers', '', 0),
(219, 1, '2018-01-10 03:04:33', '2018-01-10 03:04:33', 'Ben is the operations leader who oversees the making of the hollow titanium wide chord fan blade.\r\n\r\nFrom the moment the materials come into the factory to the point when a fan blade has passed its final test, Ben is responsible for ensuring each one is perfect.', 'Ben Khoo', 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Non iure ipsum fugit incidunt enim, dolore magnam illum eligendi', 'publish', 'closed', 'closed', '', 'ben-khoo', '', '', '2018-01-14 13:10:45', '2018-01-14 13:10:45', '', 0, 'http://localhost/generationaerospace/?post_type=genaero_trailblazers&#038;p=219', 0, 'genaero_trailblazers', '', 0),
(220, 1, '2018-01-10 03:05:22', '2018-01-10 03:05:22', '<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">Mariani fell in love with aerospace after working in a bookshop at Changi Airport and watching planes take off during her breaks.</span></p>\r\n<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">She wondered in awe about how something so big could fly in the sky for hours, and needed to find out more.</span></p>\r\n<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">Mariani worked hard to graduate from Temasek Polytechnic\'s aviation academy and was selected to become a technician, helping to assemble the Trent 900 and Trent 1000. She\'s got big plans for her career and is learning something new every day.</span></p>\r\n<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">Mariani is proof that if you work hard enough and go after what you want, you can have the career of your dreams.</span></p>', 'Mariani Dawood', 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Non iure ipsum fugit incidunt enim, dolore magnam illum eligendi', 'publish', 'closed', 'closed', '', 'mariani-dawood', '', '', '2018-01-14 13:10:42', '2018-01-14 13:10:42', '', 0, 'http://localhost/generationaerospace/?post_type=genaero_trailblazers&#038;p=220', 0, 'genaero_trailblazers', '', 0),
