(218, 1, '2018-01-10 03:03:55', '2018-01-10 03:03:55', '<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">When Anna holds an engine part in her hands, she doesn\'t just see metal and bolts: she sees hundreds of possibilities.</span></p>\n<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">Working as a repair technology manager, Anna is sent parts that have been flying in an engine and now need to be repaired or replaced.</span></p>\n<p data-anchor-link-pos-phone_portrait=\"empty\"><span data-anchor-link-pos-phone_portrait=\"empty\">Her job is to find ways to repair the part and keep it flying. And if it can\'t be done today, she\'ll partner with people all over the world to work out how to extend its life in the future.</span></p>', 'Annie Tai', '', 'inherit', 'closed', 'closed', '', '212-autosave-v1', '', '', '2018-01-10 03:03:55', '2018-01-10 03:03:55', '', 212, 'http://localhost/generationaerospace/212-autosave-v1/', 0, 'revision', '', 0),
